import { Routes, Route } from "react-router-dom";

import Home from "./routes/home/home.component";

const Shop = () => <h1>I am the shop page</h1>;

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
  );
};

export default App;
